// Group elements by tier for display
export const ELEMENTS_BY_TIER: Record<number, Element[]> = ELEMENTS.reduce(
  (acc, el) => {
    if (!acc[el.tier]) acc[el.tier] = [];
    acc[el.tier].push(el);
    return acc;
  },
  {} as Record<number, Element[]>
);

